import {atom, selector} from 'recoil';

export const navigationAtom = atom({
  key: 'navigationAtom',
  default: {
    index: 0,
    account: {
      id: 1,
      uuid: 'zap',
      name: 'Robson Cezario',
      bankMoney: 7000,
      money: 500,
      bills: 7500
    },
    withdrawInput: 0,
    creditCards: [
    {
      number: 7242,
      securityCode: 252,
      expirationDate: +(new Date())
    }],
    isAsyncRequesting: false
  } 
});
